"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Hyperthyroidism (overactive thyroid) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/hyperthyroidism-overactive-thyroid-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H471368519\">",
"      <span class=\"h1\">",
"       What is hyperthyroidism?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Hyperthyroidism is a condition that can make you feel shaky, anxious, and tired. The most common cause of hyperthyroidism is called Graves&rsquo; disease.",
"     </p>",
"     <p>",
"      There is a gland in your neck called the thyroid gland (",
"      <a class=\"graphic graphic_figure graphicRef66834 \" href=\"UTD.htm?14/43/15024\">",
"       figure 1",
"      </a>",
"      ). It makes thyroid hormone. This hormone controls how the body uses and stores energy.",
"     </p>",
"     <p>",
"      Hyperthyroidism is the medical term for when a person makes too much thyroid hormone. People sometimes confuse this condition with HYPOthyroidism, which is when a person does not make enough thyroid hormone.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H471368526\">",
"      <span class=\"h1\">",
"       What are the symptoms of hyperthyroidism?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Some people with hyperthyroidism have no symptoms. When they do occur, symptoms can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Anxiety, irritability, or trouble sleeping",
"       </li>",
"       <li>",
"        Weakness (especially in the arms and thighs, which can make it hard to lift heavy things or climb stairs)",
"       </li>",
"       <li>",
"        Trembling",
"       </li>",
"       <li>",
"        Sweating a lot and having trouble dealing with hot weather",
"       </li>",
"       <li>",
"        Fast or uneven heartbeats",
"       </li>",
"       <li>",
"        Feeling tired",
"       </li>",
"       <li>",
"        Weight loss even when you are eating normally",
"       </li>",
"       <li>",
"        Frequent bowel movements",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Hyperthyroidism can also cause a swelling in the neck called a &ldquo;goiter.&rdquo; If it is caused by Graves&rsquo; disease, the condition can also make the eyes bulge (",
"      <a class=\"graphic graphic_figure graphicRef58509 \" href=\"UTD.htm?41/45/42704\">",
"       figure 2",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Untreated hyperthyroidism can cause a heart rhythm disorder called &ldquo;atrial fibrillation,&rdquo; chest pain, and rarely, heart failure.",
"     </p>",
"     <p>",
"      In women, hyperthyroidism can disrupt monthly periods. It can also make it hard to get pregnant. In men, hyperthyroidism can cause the breasts to grow or lead to sexual problems. These problems go away when hyperthyroidism is treated.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H471368533\">",
"      <span class=\"h1\">",
"       Is there a test for hyperthyroidism?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse can test you for hyperthyroidism using a simple blood test. If the blood test indicates a problem, the doctor or nurse might run other tests, too. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H471368540\">",
"      <span class=\"h1\">",
"       How is hyperthyroidism treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Hyperthyroidism can be treated with:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Medicines",
"        </strong>",
"        &ndash; Two types of medicines can be used to treat hyperthyroidism: &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Anti-thyroid medicines reduce the amount of hormone your thyroid gland makes.",
"       </li>",
"       <li>",
"        Beta-blocker medicines help reduce the symptoms of hyperthyroidism. Beta-blockers can make you more comfortable until the thyroid imbalance is under control.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Radioactive iodine",
"        </strong>",
"        &ndash; Radioactive iodine comes in a pill or liquid you swallow. It destroys much of the thyroid gland. Pregnant women should not use this treatment, because it can damage the baby&rsquo;s thyroid gland. But the treatment is safe for women who are not pregnant and for men. The amount of radiation used is small. It does not increase the chance of getting cancer, and it does not cause problems getting pregnant in the future or increase the risk of birth defects in future pregnancies.",
"       </li>",
"       <li>",
"        <strong>",
"         Surgery",
"        </strong>",
"        &ndash; Doctors can do surgery to remove part or all of the thyroid gland. Doctors do not often recommend surgery, because the other treatment choices are safer and less costly. But surgery is the best choice in some cases. &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Most people who are treated with radioactive iodine or who have surgery end up making too little thyroid hormone after treatment. They must take thyroid hormone pills after treatment&mdash;for the rest of their life. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H471368547\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you take anti-thyroid medicine, talk to your doctor or nurse before you start trying to get pregnant. You will probably need to take different medicines at different times in your pregnancy. Plus, your doses may need to be adjusted.",
"     </p>",
"     <p>",
"      If you were treated with radioactive iodine, wait at least 6 months before you start trying to get pregnant. This will give your doctor enough time to find out if your thyroid is making enough thyroid hormone after the radioactive iodine treatment. If the radioactive iodine caused the thyroid to make too little thyroid hormone, you will need to take thyroid hormone pills. It is important to have a normal amount of thyroid hormone in your body before getting pregnant.&nbsp; &nbsp;",
"     </p>",
"     <p>",
"      Whatever treatment you use, you should have your thyroid hormone levels checked often during pregnancy. Thyroid hormone levels must be at the right level during pregnancy to avoid risks to both the mother and the baby.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H471368554\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?3/54/3938?source=see_link\">",
