"   </a>",
"   .",
"  </div>",
"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?22/9/22675/abstract/1\">",
"      Ashkenaze DM, Ruby LK. Metacarpal fractures and dislocations. Orthop Clin North Am 1992; 23:19.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?22/9/22675/abstract/2\">",
"      Burkhalter WE. Closed treatment of hand fractures. J Hand Surg Am 1989; 14:390.",
"     </a>",
