" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Epidemiology of common causes of hip pain in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Disease",
"      </td>",
"      <td class=\"subtitle1\">",
"       Typical age",
"      </td>",
"      <td class=\"subtitle1\">",
"       M:F ratio",
"      </td>",
"      <td class=\"subtitle1\">",
"       Other",
"      </td>",
"     </tr>",
