"      <td>",
"       Septic arthritis",
"      </td>",
"      <td>",
"       Any, peak 0 to 6 years",
"      </td>",
"      <td>",
"       1:1",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Transient synovitis",
"      </td>",
"      <td>",
"       3 to 8 years, mean 6 years",
"      </td>",
"      <td>",
"       2:1",
"      </td>",
"      <td>",
"       Fall/winter",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Perthes disease",
"      </td>",
"      <td>",
"       3 to 12 years, peak 5 to 7 years",
"      </td>",
"      <td>",
"       4:1",
"      </td>",
"      <td>",
"       Rare in blacks",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"3\">",
"       Slipped capital femoral epiphysis",
"      </td>",
"      <td>",
"       Early adolescence",
"      </td>",
"      <td colspan=\"1\" rowspan=\"3\">",
"       1.5:1",
"      </td>",
"      <td>",
"       Obese children",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Mean 12 years, girls",
"      </td>",
"      <td>",
"       Endocrinopathy in 8 percent",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Mean 13.5 years, boys",
"      </td>",
"      <td>",
"       Blacks &gt; whites, hispanics",
"      </td>",
"     </tr>",
